INSERT INTO `configuracoes_emails` VALUES (1,9,'<p> \r\n    Prezado(a) <span class=\"nome-cliente\">{$nome_cliente}</span>,&nbsp; &nbsp;&nbsp;<br></p><p>Situação Boleto:&nbsp;{$status_cobranca}<br>\r\n    Gostaríamos de informá-lo(a) que foi gerado um boleto.<br> no valor de <b> R$ {$valor}&nbsp;</b>,\r\n    referente\r\n    à <b>{$localizador}</b>. O vencimento do boleto está marcado para o dia <b> {$vencimento}.</b>\r\n    </p><p>\r\n        Pedimos que fique atento(a) à data de vencimento para evitar multas e juros, caso o pagamento seja realizado\r\n        após\r\n        a data estipulada.<br> É importante ressaltar que o não pagamento do boleto poderá acarretar na suspensão dos\r\n        serviços contratados.\r\n    </p><p>Lembramos que o pagamento pode ser realizado em qualquer agência bancária ou pela internet, utilizando o\r\n        código\r\n        de barras que consta no boleto.\r\n    </p><p> Em caso de dúvidas ou dificuldades no pagamento, nossa equipe de atendimento\r\n        está à disposição para auxiliá-lo(a).\r\n    </p><p>Agradecemos a preferência e ficamos à disposição para quaisquer\r\n        esclarecimentos.\r\n        </p><hr>\r\n\r\n        Caso o pagamento já tenha sido efetuado, por favor desconsidere este aviso.\r\n        <hr>\r\n        Atenciosamente,<br><b>{$razao}<br></b>{$endereco_beneficiario}<p></p><p>{$data_atual}<br></p><p><br></p>','Boleto Itau','Boleto ','mail.millgest.com.br','true','cobranca@millgest.com.br','el1nf2fEI_L6','tls','587','cobranca@millgest.com.br','Cobrança v1','2023-06-24 07:31:00','1',NULL,NULL);

